//replaces color abbreviations with hexadecimal color values
Object.keys(MobTextures).forEach(mobName => {
  MobTextures[mobName].map.forEach(yArray => {
    yArray.forEach((pixel, index) => {
      //if pixel is not already hexadecimal
      if (pixel && pixel.indexOf("#")) {
        pixel = pixel.split(":");
        try {
          yArray[index] = ColorPalette[pixel[0]][pixel[1]];
        } catch (error) {
          throw new RangeError(
            `Color with identifier ${pixel.join(":")} not found in color palette in mob with name ${mobName} in /JS/Main/Data/GameData/Mobs/MobTextures.js`
          );
        }
      }
    });
  });
});

export default MobTextures;